window.bookSummaryJSON = "<p>Since when does Aaron Olson have abs like that? I haven’t seen him since high school, but now I find myself desperate to see much more of him.</p> <p>Sarah Anderson's plan for the Cupid's Crush event at the local bar, High Five, is straightforward: enjoy some playful banter and score a free drink. After a decade on the West Coast, Sarah’s still adjusting to life back in her small Wisconsin hometown, surrounded by familiar faces—until one of them completely catches her off guard. Aaron Olson, the once scrawny high school wrestler, is now tending bar shirtless with fluffy angel wings strapped to his back, revealing a physique that is distracting in the best way.</p> <p>What starts as light-hearted banter turns into a flirtatious game of cat and mouse, where Sarah learns that you shouldn’t judge someone by who they were in high school—because they might just surprise you in the most irresistible ways.</p> <p>In this flirty and steamy Valentine’s themed novella, discover the thrill of seeing an old friend in a whole new light, and watch sparks fly as past perceptions are shattered and new attractions take hold.</p> <p>(This is Book #2 in an interconnected series. It is encouraged, but not essential, to listen to Santa's Coming before listening to Cupid's Shot.)</p> <p>Romance Tropes: Second Chance (at a first chance), Friends to Lovers, Small Town, Holiday Romance, He Falls First, Secret Admirer</p>"; 
